// Define the LeafletPicker component
const LeafletPicker: React.FC = () => {
  const bounds = L.latLngBounds(
    [38.8933, -77.0473], // Southwest corner
    [38.9181, -77.0030] // Northeast corner
  );

let trafficLayer: L.GeoJSON | null = null;

const renderAnimatedTrafficGraph = (map: L.Map, edgeGraph: EdgeGraph) => {
  const colorMap = {
    0: '#00FF00', // Low traffic (green)
    1: '#FFFF00', // Medium traffic (yellow)
    2: '#FFA500', // High traffic (orange)
    3: '#FF0000', // Very high traffic (red)
  };

  const features: Feature<LineString, { color: string; weight: number; id: number }>[] = Object.values(edgeGraph.edges).map(edge => ({
    type: 'Feature',
    geometry: edge.geometry,
    properties: {
      color: colorMap[edge.edgeColor as keyof typeof colorMap || 0],
      weight: edge.weight,
      id: edge.id,
    },
  }));

  const featureCollection: FeatureCollection = {
    type: 'FeatureCollection',
    features,
  };

  console.log("Generated GeoJSON Features:", featureCollection);

  if (trafficLayer) {
    trafficLayer.clearLayers();
    trafficLayer.addData(featureCollection);
  } else {
    trafficLayer = L.geoJSON(featureCollection, {
      style: (feature) => {
        if (feature && (feature.geometry.type === 'LineString' || feature.geometry.type === 'MultiLineString')) {
          return {
            color: feature?.properties?.color || '#000000', // Stroke color
            weight: 3,      // Stroke width
            opacity: 1.0,                                  // Stroke opacity
          };
        }
        return {}; // Default empty style for non-LineString geometries
      },
      onEachFeature: (feature, layer) => {
        layer.bindPopup(`
          Route ID: ${feature.properties.id}
          Traffic Volume: ${feature.properties.weight}
          Color: ${feature.properties.color}
        `);
      },
    }).addTo(map);
    console.log("iwuf", trafficLayer)
  }
};


  useEffect(() => {
    // Initialize the map
    const map = L.map('map', {
      center: new L.LatLng(38.9052, -77.0267),
      zoom: 40,
      minZoom: 18,
      maxBounds: bounds,
      maxBoundsViscosity: 1.0,
    }); // Centered on Washington, DC

    // Add tile layer
    L.tileLayer("https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png", {
      attribution:
        '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors',
    }).addTo(map);

    // Feature group for drawn items
    const drawnItems = new L.FeatureGroup();
    map.addLayer(drawnItems);

    // Add draw controls
    const drawControl = new L.Control.Draw({
      edit: {
        featureGroup: drawnItems,
        remove: true,
      },
      draw: {
        marker: {}, // Enable placing markers
        polyline: false, // Disable drawing polylines
        polygon: false, // Disable drawing polygons
        circle: false, // Disable drawing circles
        rectangle: false, // Disable drawing rectangles
        circlemarker: false, // Disable drawing circle markers
      },
    });
    map.addControl(drawControl);

    // Handle draw events
    map.on(L.Draw.Event.CREATED, function (event: any) {
      const layer = event.layer;
      drawnItems.addLayer(layer);
      const geoJson = layer.toGeoJSON();
      console.log("Closure GeoJSON:", geoJson);

      if (event.layerType === "marker") {
        const coordinates = layer.getLatLng(); // Get latitude and longitude of the marker
        const edgeGraph = new EdgeGraph(geoData);  // geoData is already a FeatureCollection
        const curEdge = edgeGraph.findEdgeContainingPoint([coordinates.lng, coordinates.lat]);
        const trafficSim = new TrafficSimulation();
        console.log("heiru", curEdge)
        trafficSim.distributeTrafficRecursively(curEdge!!, 30000, []);
        console.log("curEddge:", curEdge)
        if (curEdge) {
          console.log("map", map)
          console.log("edgegraph",edgeGraph)
          renderAnimatedTrafficGraph(map, edgeGraph);
        }
      }
    });

    return () => {
      map.remove(); // Clean up on component unmount
    };
  }, [bounds]);

  return <div id="map" className="relative w-full h-full"></div>;
};

